import { Container } from "@mui/material";
import React from "react";

const Content = () => {
  return (
    <Container>
      <Container 
      component="img"
      image="https://www.tunepocket.com/wp-main/uploads/Trending-Now.jpg">
        <img src="https://media.npr.org/assets/img/2014/04/07/istock_000017744369medium_wide-e08364493518a4650db7c3513b340cac55e3b21a.jpg" />
      </Container>
    </Container>
  );
};

export default Content;
